# Function to convert CSV to Excel
def csv_to_excel(csv_file):
    df = pd.read_csv(csv_file)
    output = io.BytesIO()
    with pd.ExcelWriter(output, engine='xlsxwriter') as writer:
        df.to_excel(writer, index=False)
    excel_data = output.getvalue()
    return excel_data, df

# Function to convert Excel to CSV
def excel_to_csv(excel_file):
    df = pd.read_excel(excel_file)
    output = io.StringIO()
    df.to_csv(output, index=False)
    csv_data = output.getvalue()
    return csv_data, df

# Function to create download link
def get_download_link(file_data, filename, text):
    b64 = base64.b64encode(file_data).decode()
    return f'<a href="data:application/octet-stream;base64,{b64}" download="{filename}">{text}</a>'

# Main App Logic
def main():
    set_custom_ui()

    st.markdown("<h1 class='title'>Stormy File Converter</h1>", unsafe_allow_html=True)
    st.markdown("<p class='subtitle'>Convert CSV to Excel or Excel to CSV Amidst Thunder & Snow!</p>", unsafe_allow_html=True)

    # Conversion type selection with radio buttons
    conversion_type = st.radio(
        "Select Conversion Type:",
        ("CSV to Excel", "Excel to CSV"),
        horizontal=True
    )

    uploaded_file = st.file_uploader("Upload File", type=['csv', 'xlsx'], accept_multiple_files=False)

    if uploaded_file is not None:
        st.success("File uploaded successfully!")
        
        if st.button("Convert Now"):
            with st.spinner("Converting amidst the storm..."):
                try:
                    if conversion_type == "CSV to Excel" and uploaded_file.name.endswith('.csv'):
                        excel_data, df = csv_to_excel(uploaded_file)
                        st.write("Preview:")
                        st.dataframe(df.head())
                        download_link = get_download_link(excel_data, "converted_file.xlsx", "Download Excel File")
                        st.markdown(download_link, unsafe_allow_html=True)

                    elif conversion_type == "Excel to CSV" and uploaded_file.name.endswith('.xlsx'):
                        csv_data, df = excel_to_csv(uploaded_file)
                        st.write("Preview:")
                        st.dataframe(df.head())
                        download_link = get_download_link(csv_data.encode(), "converted_file.csv", "Download CSV File")
                        st.markdown(download_link, unsafe_allow_html=True)

                    else:
                        st.error("Please upload a matching file (CSV for CSV-to-Excel, Excel for Excel-to-CSV).")
                except Exception as e:
                    st.error(f"Error: {str(e)}")
            st.balloons()

    st.markdown("<div class='footer'>All Rights Reserved - Kashan</div>", unsafe_allow_html=True)

if __name__ == "__main__":
    main()